import React from 'react';
import { Nav } from 'react-bootstrap';
import PropTypes from 'prop-types';

/**
 * CitySubmenu muestra una barra de pestañas con las ciudades disponibles.
 * 
 * Props:
 * - cities: array de nombres de ciudades.
 * - selectedCity: la ciudad actualmente seleccionada.
 * - onSelectCity: callback que se invoca al seleccionar una ciudad.
 */
const CitySubmenu = ({ cities, selectedCity, onSelectCity }) => {
  return (
    <Nav variant="tabs" activeKey={selectedCity} onSelect={onSelectCity} className="mb-3">
      {cities.map((city) => (
        <Nav.Item key={city}>
          <Nav.Link eventKey={city}>{city}</Nav.Link>
        </Nav.Item>
      ))}
    </Nav>
  );
};

CitySubmenu.propTypes = {
  cities: PropTypes.arrayOf(PropTypes.string).isRequired,
  selectedCity: PropTypes.string.isRequired,
  onSelectCity: PropTypes.func.isRequired,
};

export default CitySubmenu;
